import React from "react";

const AuthSection = () => {
  return (
    <div className="auth-section">
      
      <div className="auth-buttons">
        <button className="sign-up">Sign Up</button>
        <button className="login">Login</button>
      </div>
    </div>
  );
};

export default AuthSection;
